import React, { Component } from "react";
import Container from 'react-bootstrap/Container';
import MapView from "../components/Map/MapView";

export default class Maps extends Component {
  render() {
    return (
      <>
        <Container className="p-4">
            <MapView></MapView>
        </Container>
      </>
    );
  }
}
